import start0 from "./images/start0.png";

export default function HangmanLogic() {
  return (
    <div className="w-full flex justify-center object-center p-4 h-3/4">
      <ul>
        <li>1</li>
        <li>2</li>
        <li>3</li>
      </ul>
      <h1>Name: Ivo</h1>
      <h1>Score: 231</h1>
      <h1>Time: 41s</h1>
      <img src={start0} className="mt-20 h-1/2" alt="hangmangame" />
    </div>
  );
}
